import ReactDOM from 'react-dom'
import img from './dog.jpg'
import useMouse from './useMouse'
function Dog() {
  const { x, y } = useMouse()
  return (
    <img
      src={img}
      style={{ position: 'absolute', left: x, top: y, 
      width: 100, height: 100 }}
      alt=""
    />
  )
  
}
ReactDOM.render(<Dog></Dog>, document.getElementById('root'))
